B.a2D=new A.V(B.jy,["PARA TOMAR BANHO, PRECISO TIRAR O COLETOR?","N\xe3o. Voc\xea pode tomar banho normalmente com o coletor, pois os materiais do equipamento foram produzidos para resistir e permanecer fixo a pele. No entanto, \xe9 preciso avaliar se a placa j\xe1 est\xe1 muito saturada (esbranqui\xe7ada e diminuindo a ades\xe3o) e se j\xe1 \xe9 o momento de realizar a troca da bolsa coletora. Lembre-se que o tempo da troca da bolsa coletora pode variar de pessoa pra pessoa, vai depender da satura\xe7\xe3o da placa, descolamento, suor excessivo e presen\xe7a de vazamento das fezes."],t.w)
B.a2B=new A.V(B.jy,["PRECISAREI TER CUIDADO COM AS ROUPAS?","Voc\xea poder\xe1 usar as mesmas roupas que usava antes. Tenha cuidado apenas para n\xe3o usar roupas nas quais o el\xe1stico perpassa a bolsa coletora, diminuindo o reservat\xf3rio. Passe o el\xe1stico acima ou abaixo, mas nunca no meio dela. Consulte o profissional sobre se no seu caso \xe9 indicado o uso de cintas abdominais ou outros dispositivos que facilitem o uso da bolsa coletora."],t.w)
B.a2A=new A.V(B.jy,["POSSO TOMAR BANHO DE MAR E PISCINA?","Sim. Voc\xea pode realizar as atividades que fazia antes normalmente. Para se sentir confort\xe1vel, voc\xea pode fazer uso de pe\xe7as de banho que se adequem a bolsa coletora, conforme suas prefer\xeancias."],t.w)
B.a2C=new A.V(B.jy,["COMO \xc9 O PROCESSO DE REVERS\xc3O DA ESTOMIA E COM QUANTO TEMPO SE FAZ?","A revers\xe3o \xe9 a cirurgia para reconectar as partes separadas do intestino e com isso refazer o tr\xe2nsito normal da fezes para a sa\xedda pelo \xe2nus. As pessoas com estomias tempor\xe1rias podem realizar a revers\xe3o. O tempo para realizar a revers\xe3o vai mudar de pessoa para pessoa e depender da causa que levou a produ\xe7\xe3o da estomia, recupera\xe7\xe3o do intestino e disponibilidade da cirurgia no servi\xe7o de sa\xfade."],t.w)
