B.t4=A.a(s(["Mudar a bolsa coletora quando a placa estiver com colora\xe7\xe3o esbranqui\xe7ada, quando for observado sinais de vazamento ou descolamento/enrugamento da placa.Mudar a bolsa coletora quando a placa estiver com colora\xe7\xe3o esbranqui\xe7ada, quando for observado sinais de vazamento ou descolamento/enrugamento da placa.","O lugar ideal para trocar a bolsa coletora \xe9 geralmente o banheiro, no momento do banho. Se for sair, lembre-se sempre de levar uma garrafa com \xe1gua, bolsa coletora extra e um recipiente para desprezar os res\xedduos, caso n\xe3o tenha acesso a um banheiro.","A presen\xe7a de pele oleosa e suor podem aumentar a frequ\xeancia com que o sistema de bolsa coletoras \xe9 alterado.","A troca da bolsa coletora \xe9 melhor realizada no in\xedcio da manh\xe3 (antes de comer ou beber) quando o intestino est\xe1 menos ativo, principalmente para pessoas com ileostomias.","Se o estoma foi formado dentro das \xfaltimas oito semanas, ele precisa ser medido semanalmente, devido ao incha\xe7o da estomia ap\xf3s a cirurgia."]),t.s)
