B.a0E=new A.V(B.aa,["1- Lave as m\xe3os. Separe o material necess\xe1rio: bolsa de uma pe\xe7a limpa, toalha, tesoura e sabonete de uso di\xe1rio.","assets/images/selfcare/cares/changing/simplebag/figure_1.png"],t.w)
B.a0R=new A.V(B.aa,["2- Esvazie a bolsa no vaso sanit\xe1rio, caso tenha fezes. Para isso, retire a presilha e aperte a bolsa para a sa\xedda de todo o conte\xfado.","assets/images/selfcare/cares/changing/simplebag/figure_2.png"],t.w)
B.a0F=new A.V(B.aa,["3- Retire a bolsa com cuidado, empurrando a pele, enquanto separa a parte adesiva. Jogue-a no lixo.","assets/images/selfcare/cares/changing/simplebag/figure_3.png"],t.w)
B.a0Q=new A.V(B.aa,["4- Lave com cuidado o estoma e a pele ao redor com \xe1gua e sabonete, sem esfregar. Depois, seque bem.","assets/images/selfcare/cares/changing/simplebag/figure_4.png"],t.w)
B.a0Z=new A.V(B.aa,["5- Me\xe7a o tamanho da estomia com o guia de medi\xe7\xe3o. Caso n\xe3o tenha o guia, tente ver o tamanho mais pr\xf3ximo do formato da sua estomia.","assets/images/selfcare/cares/changing/simplebag/figure_5.png"],t.w)
B.a10=new A.V(B.aa,["6- Recorte a placa da bolsa do mesmo tamanho da estomia, sem deixar espa\xe7os entre a bolsa e a estomia ou evitando apertar o estoma.","assets/images/selfcare/cares/changing/simplebag/figure_6.png"],t.w)
