B.a0m=new A.V(B.df,["Dermatite de contato irritante","assets/images/selfcare/cares/complications/figure_1.png","Irrita\xe7\xe3o da pele ao redor do estoma devido ao contato das fezes com a pele (vazamentos). Corte a abertura da bolsa coletora no tamanho do estoma e converse com o(a) enfermeiro(a) para ver a necessidade de uso de outros produtos."],t.w)
B.a0l=new A.V(B.df,["Granulomas","assets/images/selfcare/cares/complications/figure_2.png","Pequenos n\xf3dulos localizados geralmente nas bordas do estoma e na jun\xe7\xe3o entre o estoma e a pele. Os n\xf3dulos s\xe3o geralmente vermelhos e sangram com contato ou trauma. Procure o(a) enfermeiro(a) para a indica\xe7\xe3o de produtos espec\xedficos."],t.w)
B.a0h=new A.V(B.df,["H\xe9rnia","assets/images/selfcare/cares/complications/figure_3.png","Acontece quando parte do intestino atravessa a parede muscular do abd\xf4men, causando eleva\xe7\xe3o da regi\xe3o. Recomenda-se o uso de cinto de suporte, bolsa coletora de pe\xe7a \xfanica e produtos para evitar vazamento das fezes. Evite levantar pesos. Comunique o(a) enfermeiro(a)."],t.w)
B.a0o=new A.V(B.df,["Separa\xe7\xe3o mucocut\xe2nea","assets/images/selfcare/cares/complications/figure_4.png","Separa\xe7\xe3o entre a estomia e a pele. O tratamento \xe9 baseado no uso p\xf3 para estomias e outros adjuvantes. Procure ajuda do(a) enfermeiro(a) para o tratamento dessa complica\xe7\xe3o."],t.w)
B.a0n=new A.V(B.df,["Isquemia e necrose","assets/images/selfcare/cares/complications/figure_5.png","Acontece quando estoma est\xe1 com a circula\xe7\xe3o sangu\xednea prejudicada. O estoma aparece menos brilhante, com colora\xe7\xe3o escurecida. Procure ajuda do(a) enfermeiro(a), caso note essas carcater\xedsticas."],t.w)
B.a0i=new A.V(B.df,["Estenose","assets/images/selfcare/cares/complications/figure_6.png","Diminui\xe7\xe3o da abertura do estoma, com sa\xedda de gases barulhentos. Comunique ao(\xe0) enfermeiro(a) a presen\xe7a desses sinais. Observe sempre se as fezes est\xe3o saindo normalmente."],t.w)
B.a0j=new A.V(B.df,["Prolapso","assets/images/selfcare/cares/complications/figure_7.png","Ocorre quando parte da al\xe7a intestinal sai para fora do abd\xf4men. Ajuste o recorte da abertura da bolsa coletora e use bolsa coletora de uma pe\xe7a. Converse com o(a) enfermeiro(a) para indica\xe7\xe3o de produtos para proteger a pele."],t.w)
B.a0k=new A.V(B.df,["Retra\xe7\xe3o","assets/images/selfcare/cares/complications/figure_8.png","Ocorre quando o estoma n\xe3o tem uma altura (protus\xe3o) adequada e se apresenta encolhido ou nivelado com a pele. Pode ser necess\xe1rio usar uma bolsa coletora com placa convexa. Converse com o(a) enfermeiro(a) para a escolha adequada."],t.w)
